import ExpenseItem from "./components/ExpenseItem";
function App() {
  const expenses=[
   {
    id:'1 ',
    titile:'Car Insurnce',
    amount:94.12,
    date:new Date()
   },
   {
    id:'2',
    title:'New Tv',
    amount:98.08,
    date:new Date()
   },
   {
    id:'3',
    title:'New Bike',
    amount:9888.08,
    date:new Date()
   },
   {
    id:'4',
    title:'New Fridge',
    amount:9809.08,
    date:new Date()
   }

  ];

  return (

    <div >

      <h1>Hello World!!</h1>
      <ExpenseItem title={expenses[0].title}
       amount={expenses[0].amount}
       date={expenses[0].date}></ExpenseItem>
      <ExpenseItem 
      title={expenses[1].titile}
      amount={expenses[1].amount}
      date={expenses[1].date}></ExpenseItem>
      <ExpenseItem
      title={expenses[2].title}
      amount={expenses[2].amount}
      date={expenses[2].date}
      ></ExpenseItem>

    </div>
  );
}

export default App;
